  const {state, getToken} = useContext(AuthContext);

  useEffect(() => {
    console.log(state);
  },[state]);

  return(
      <div>
        <button onClick={() => {
          getToken();
        }}>Start Game</button>
      </div>
  )
}

export default () => {
  return (
      <AuthProvider>
        <App/>
      </AuthProvider>
  )
}
